const _hoisted_7 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Saber</li><li>True Name: Queen Medb</li><li>Sex: Female</li><li>Origin: Celt myth/Servant Summer Festival!</li><li>Region: Northern Europe</li><li>Alignment: Chaotic Evil</li><li>Height: 154cm</li><li>Weight: 41kg</li></ul><p><strong>Meta</strong></p><ul><li>Design: Sakurai Hikaru</li><li>Character Design: Takayama Kisai</li><li>Voice: Sakura Ayane</li><li>Appears in: FGO</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">EX</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">A+</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Magic Resistance: [B+]</strong></p><p>Nullifies all magecraft with less than 3 incantations.</p><p>Receives almost no damage even from rituals and greater magecraft.</p><p>After changing her Saint Graph to Saber, it seems some of her skills have also been upgraded.</p><p><strong>Riding: [A]</strong></p><p>Medb being Medb, there is almost nothing or no one she can&#39;t ride.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>If I Change Into My Swimsuit: [A+]</strong></p><p>Her ability to enchant the masses or specific people.</p><p>At A+ its power is tremendous.</p><p>(Usually this would be a composite skill that includes Golden Rule (body), but in FGO its effect is a bit different)</p><p><strong>Eau De Toilette - White Honey: [B]</strong></p><p>Medb&#39;s voice and breath are endowed with a honey-like sweetness, which allows her to influence the target&#39;s stats just by existing.</p><p>In the case of animals or humans without protection against magical power, she should be perfectly capable of bending them to her will.</p><p>For example, it&#39;d be easy for her to turn a small boy into a brave warrior comparable with a veteran. Conversely, she could also take a hardened warrior and turn them into a child.</p><p>She can even freely mess with a Servant&#39;s stats if they don&#39;t have the means to resist.</p><p>A skill similar but different to &quot;Alcoholic Fruit &quot;.</p><p>When using this skill, she applies perfume to herself, so if one were to interrupt her, the skill could maybe be interrupted...But one must wonder how many people are out there who can actually stop Medb.</p><p><strong>Discipline of the Queen (Sea): [A]</strong></p><p>Medb&#39;s charisma as a queen has now reached the level of violence.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="fergus-my-good-looking-brave-my-dear-boyfriend-s-rainbow-sword" tabindex="-1"><a class="header-anchor" href="#fergus-my-good-looking-brave-my-dear-boyfriend-s-rainbow-sword" aria-hidden="true">#</a> Fergus My Good-Looking Brave - My Dear Boyfriend&#39;s Rainbow Sword</h1><ul><li>Rank: B</li><li>Type: Anti-Unit</li><li>Range: 1~20</li><li>Maximum Targets: 1~10</li></ul><p>Fergus My Good-Looking Brave.</p><p>Fergus was one of Medb&#39;s lovers during her life, and now she&#39;s taken his demonic sword Caladbolg to use as a weapon.</p><p>It is possible to use it by casting its true name, but Medb&#39;s holding back this time. Even Medb, or rather, precisely because this is Medb, there is no way that she would ruin a beautiful resort by causing an earthquake.</p><p>Nobody knows if her having this Noble Phantasm is due to her legend of being able to make any hero hers, or if she simply borrowed it from the Fergus in Chaldea.</p><p>Its power obviously decreases compared to when Fergus uses it, but its flexibility and versatility have been upgraded in exchange.</p><p>Whenever Medb cutely swings the sword, small rainbows become visible.</p><h1 id="one-shot-my-love-my-dear-romantic-rendezvous" tabindex="-1"><a class="header-anchor" href="#one-shot-my-love-my-dear-romantic-rendezvous" aria-hidden="true">#</a> One-shot My Love - My Dear Romantic Rendezvous</h1><ul><li>Rank: A+</li><li>Type: Anti-Unit</li><li>Range; 1~40</li><li>Maximum Targets: 1</li></ul><p>One-shot My Love.</p><p>A one-time summer romance. A one-time commemorative photo (one-shot).</p><p>The normal Medb possesses the special attribute of having the Noble Phantasm of every hero who fell for her, but having changed her saint graph with a swimsuit, she also gained a new Noble Phantasm.</p><p>In other words, this is a fearsome anti-unit sure-kill Noble Phantasm that utilizes one of Medb&#39;s greatest weapons, her &#39;beauty&#39;.</p><p>Medb will be walking while humming, and by simply giving her target a &#39;Well, hello there&#39;, they will inevitably fall for her and be trapped in a summer love. It is inevitable.</p><p>The target will then have no choice but to fall exhausted into the summer sky after being toyed with by her.</p><p>Whoever gets targeted by this Noble Phantasm should feel proud of themselves.</p><p>After all, only the few chosen good-looking braves, or rather, good-looking slaves are the ones who get approached by Medb.</p><p>This is a Noble Phantasm that works by using her charm, but surprisingly it doesn&#39;t apply a continuous charm effect.</p><p>&#39;Well, that&#39;s what summer romances are like, right?&#39;, is what Medb herself says.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>She&#39;s the same as always.</p><p>Pure and clean. The seductive and vicious Queen Medb.</p><p>The beautiful flower that blooms at the center of the universe.</p><p>Or rather, the grand flower with seeks to engulf the whole world with her blooming beauty.</p><p>In addition, she&#39;s now something similar to a gravure idol. She&#39;s aware of her nature as someone who draws other people in.</p><p>Since Medb is well aware of the power and value of her own body, it was only a matter of time before she settled into modern times and became a glamorous Servant.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>Same as always.</p><p>She will not give them special treatment. She simply treats them as any another fan or photographer worshipping her.</p><p>There are rumors that she&#39;ll allow you to conduct a private photo session if you get her to say something like &#39;looks like you&#39;re quite the good-looking brave yourself&#39;, so please do your best.</p><h2 id="miscellaneous" tabindex="-1"><a class="header-anchor" href="#miscellaneous" aria-hidden="true">#</a> Miscellaneous</h2><p>It seems she&#39;s gotten really into making her own albums.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Cu Chulainn:</strong></p><p>I&#39;m already loved and worshipped by so many people, so I don&#39;t want you, ok?</p><p>(Or so she wants to say, but can&#39;t. She really loves Cu. If he still won&#39;t look at her, then there&#39;s no choice but to resort to brainwashing. Or so she had decided, but when she finally meets Cu she just wishes he&#39;d tell her something like &#39;that saint graph&#39;s not bad&#39;.)</p><p><strong>Fergus:</strong></p><p>T-h-a-n-k-s\u2764</p><p>Let me borrow your wonderful sword for a bit, ok?</p><p>I could change my own Saint Graph if I wanted, but hey, a Saber&#39;s gotta have a sword, right?</p><p>Yeah! Now I&#39;m a Saber too!</p><p>I&#39;ll go beat up Cu!</p><p><strong>Scathach:</strong></p><p>I finally got a swimsuit!</p><p>Now I can have a summer battle on even footing with that woman.</p><p>...Or so I thought but she didn&#39;t say anything and just gave me a grin. What&#39;s her deal!?</p><p>Scathach-Skadi:</p><p>She has her same face, so how is she so different...</p><p>And how come she interests me so much?</p><p>Hmmm...</p><p>Well for now, let&#39;s just go to the beach together!</p><p><strong>Tomoe Gozen:</strong></p><p>I can&#39;t help but be concerned about her status as widow.</p><p>It doesn&#39;t seem like she&#39;s simply being faithful, but, that girl is like...</p><p>...I guess I have no choice but to confirm it myself.</p><p><strong>Any male Servant she likes:</strong></p><p>I think that would feel different when I&#39;m a Saber, compared to when I was a Rider.</p><p>So now I have to confirm \u2764.</p><p><strong>Fionn mac Cumhaill:</strong></p><p>I hate men who won&#39;t obey me.</p><p>He won&#39;t stop talking proudly about his wife either, what&#39;s with him!?</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>I was instructed to make Caladbolg into a weapon that could change and turn into a whip, then I also got some really extreme Medb-like suggestions from Takeuchi, and well after I kept stacking things on her the design was obviously rejected (lmao). As for Medb&#39;s swimsuit, her first one&#39;s the only one suited for swimming comfortably, her second stage is for beachside photoshoots, and her third stage is for indoor studios. Her cute little penguin friend becomes about as big as a polar bear on her final ascencion, and he&#39;s super soft to the touch too! (Takayama Kisai).</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p>(Lib will add after publish)</p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 98);
